import "./App.css";
import { Parallax, ParallaxLayer } from "@react-spring/parallax";

import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";
import Locations from "./routes/locations/locations.component";

const MainComponent = () => {
  return (
    <div
      className="main-component"
      style="background-image: url(https://imgs.search.brave.com/0kUMgKr2WoF-AJijy0j09R85VB_--I0n1XLMsDl5Mq4/rs:fit:1200:1200:1/g:ce/aHR0cDovL3d3dy5w/aXhlbHN0YWxrLm5l/dC93cC1jb250ZW50/L3VwbG9hZHMvMjAx/Ni8wNi9MaWdodC1C/bHVlLVdhbGxwYXBl/ci1CYWNrZ3JvdW5k/cy1GcmVlLURvd25s/b2FkLmpwZw);"
    >
      <h1>Main Component</h1>
    </div>
  );
};

const ParallaxComponent = ({ speed }) => {
  return (
    <ParallaxLayer speed={speed}>
      <div>
        <h2>Parallax Component</h2>
      </div>
    </ParallaxLayer>
  );
};

const App = () => {
  return (
    <Parallax pages={4}>
      <MainComponent />
      <ParallaxComponent speed={0.5} />
      <ParallaxComponent speed={0.75} />
      <ParallaxComponent speed={1} />
    </Parallax>
  );
};

export default App;
